import React from 'react';
// import './App.css';


const Login = () => {
    return (
    <body className='text-center'>
    <form className='form-signin form-group'>
    <h1 className="h3 mb-3 font-weight-normal">Login or Sign-up</h1>
    <div className='d-inline-block'>
    <label for="inputUser" className="sr-only">Username</label>
    <input type='text' id="inputUsername" className='form-group' placeholder='Username' required autoFocus></input>
    <div>
    <label for="inputPass" className="sr-only">Password</label>
    <input type='text' id="inputPassword" className='form-group' placeholder='Password' required></input>
    </div>
        <div className='w-25 center'>
    <button className='btn btn-lg btn-primary btn-block' type="submit">Log in</button>
    <button className='btn btn-lg btn-success btn-block' type="submit">Register</button>
    </div>
    </div>
    </form>
    {/* <Link to='/login'>login</Link> */}
    </body>
    )
}

export default Login
